import React from 'react';
import './App.css';
import Nav from './Nav'
import About from './About'
import Interviews from './Interviews'
import {BrowserRouter as Router, Switch, Route } from  'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Nav />
        <About />
        <Interviews />
      </div>
    </Router>
  );
}

export default App;
